import React from "react";
import Box from "@mui/material/Box";
import { Card, CardContent, Typography } from "@mui/material";

function Cart() {
  return (
    <div>
     <h1>Cart</h1>
      <h3>TO DO LIST</h3>
      <Box>
        <h3>TO DO LIST</h3>
        <Card sx={{margin:'2rem'}}>
          <CardContent>
            <Typography>Task pending</Typography>
          </CardContent>
        </Card>
        <Card>
          <CardContent>
            <Typography>Task Completed</Typography>
          </CardContent>
        </Card>
      </Box>
    </div>
  );
}

export default Cart;
